import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import './App.css';

import Footer from './components/Footer/styles/Footer'
import HomePage from './pages/HomePage'
import AboutPage from './pages/AboutPage'

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      title: "Bryan Ge | Portfolio",
      headerLinks: [
        { title: 'Home', path: '/'},
        { title: 'About', path: '/about'},
        { title: 'Resume', path: '/resume'}
      ],
      home: {
        title: 'Hi! I\'m Bryan Ge.',
        subTitle: 'I am a freshman studying CS + Statistics at UIUC.',
      },
      about: {
        title: 'About Me'
      }
    }
  }

  render() {
    return (
      <Router>
        <Container className="p=0" fluid={true}>

          <Navbar className="border-bottom" bg="transparent" expand="lg">
            <Navbar.Brand>Bryan Ge</Navbar.Brand>
            <Navbar.Toggle className="border-0" aria-controls="navbar-toggle"/>
            <Navbar.Collapse id="navbar-toggle">
              <Nav className="ml-auto">
                <Link className="nav-link" to="/">Home</Link>
                <Link className="nav-link" to="/about">About</Link>
                <a className="nav-link" href={"https://drive.google.com/file/d/1H4-sfzxQG9cpSsKMzuQUFK3NX5h8d0V5/view?usp=sharing"} target="_blank">Resume</a>
                </Nav>
            </Navbar.Collapse>
          </Navbar>

          <Route path="/" exact render={() => <HomePage title={this.state.home.title} subTitle={this.state.home.subTitle}/>} />
          <Route path="/about" exact render={() => <AboutPage title={this.state.home.title} />} />

          <Footer />

        </Container>
      </Router>
    );
  }
}

export default App;
